import React from 'react';

import SHOP_DATA from './shopData';

export class Shop extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      shopItems: SHOP_DATA
    };
  }
  render() {
    return <div>Shop page</div>;
  }
}

export default Shop;
